import React from "react";



export const Tile = ({tile}) => {


  return (
    <div className="tile-container">
      
    

      <p>name:{Object.values(tile)[0]}</p>

<p>number:{Object.values(tile)[1]}</p>

<p>email:{Object.values(tile)[2]}</p>


     




     

    </div>
  );
};



